import React, { useState, useEffect } from "react";

const AddRecipe = () => {
    const [recipe, setRecipe] = useState({
        Recipe_title: "",
        Ingredients: "",
        Instructions: "",
        Cooking_time: "",
    });
    const [recipes, setRecipes] = useState([]); // Store fetched recipes
    const userId = localStorage.getItem("userId"); // Get user ID from localStorage

    // Fetch recipes when component loads
    useEffect(() => {
        if (userId) {
            fetchRecipes();
        }
    }, [userId]);

    const fetchRecipes = async () => {
        try {
            const response = await fetch(`http://localhost:3007/recipes/${userId}`);
            const data = await response.json();
            setRecipes(data);
        } catch (error) {
            console.error("Error fetching recipes:", error);
        }
    };

    const handleChange = (e) => {
        setRecipe({
            ...recipe,
            [e.target.name]: e.target.value,
        });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        if (!userId) {
            alert("Please log in first.");
            return;
        }

        try {
          const response = await fetch("http://localhost:3007/add", {
            method: "POST",
            headers: { "Content-Type": "application/json" },
            body: JSON.stringify({ ...recipe, userId }),
        });
        
               
            const data = await response.json();
            alert(data.message);
            setRecipe({ Recipe_title: "", Ingredients: "", Instructions: "", Cooking_time: "" });
            fetchRecipes(); // Refresh the recipes list
        } catch (error) {
            console.error("Error adding recipe:", error);
        }
    };

    return (
        <div className="container">
            <div className="form-container">
                <h2>Add Recipe</h2>
                <form onSubmit={handleSubmit}>
                    <div className="form-group">
                        <label>Recipe Title:</label>
                        <input
                            type="text"
                            name="Recipe_title"
                            value={recipe.Recipe_title}
                            onChange={handleChange}
                            required
                        />
                    </div>
                    <div className="form-group">
                        <label>Ingredients:</label>
                        <textarea
                            name="Ingredients"
                            value={recipe.Ingredients}
                            onChange={handleChange}
                            required
                        />
                    </div>
                    <div className="form-group">
                        <label>Instructions:</label>
                        <textarea
                            name="Instructions"
                            value={recipe.Instructions}
                            onChange={handleChange}
                            required
                        />
                    </div>
                    <div className="form-group">
                        <label>Cooking Time (mins):</label>
                        <input
                            type="number"
                            name="Cooking_time"
                            value={recipe.Cooking_time}
                            onChange={handleChange}
                            required
                        />
                    </div>
                    <button type="submit" className="submit-btn">Add Recipe</button>
                </form>
            </div>

            {/* Display Recipes */}
            <div className="recipes-list">
                <h2>Your Recipes</h2>
                {recipes.length === 0 ? (
                    <p>No recipes added yet.</p>
                ) : (
                    recipes.map((r) => (
                        <div key={r._id} className="recipe-card">
                            <h3>{r.Recipe_title}</h3>
                            <p><strong>Ingredients:</strong> {r.Ingredients}</p>
                            <p><strong>Instructions:</strong> {r.Instructions}</p>
                            <p><strong>Cooking Time:</strong> {r.Cooking_time} mins</p>
                        </div>
                    ))
                )}
            </div>
        </div>
    );
};

export default AddRecipe;
